import React, { Component } from "react";
import { Row, Col, Container } from "react-bootstrap";

class Dashboard extends Component {
  render() {
    return (
      <>
        <Container>
          <Row>
            <Col>Dashboard</Col>
          </Row>
        </Container>
      </>
    );
  }
}

export default Dashboard;
